import React from "react";
import BookItem from "./BookItem";

const List = (props) => {

    return (
        <ul>
            {props.items?.map((books) => (
                <BookItem
                    key={book.id}
                    title={book.title}
                    author={book.author}
                    publicationDate={book.publicationDate}
                    genre={book.genre} 
                />
            ))}
        </ul>
    );
}

export default List;
